import type { ClassicCard, ContentCards } from '@braze/web-sdk';
import { showContentCards } from '@braze/web-sdk';
//import braze from '@braze/web-sdk';
import { getCachedContentCards } from '@braze/web-sdk';
import { css } from '@emotion/react';
import { palette } from '@guardian/source/foundations';
import { useEffect, useRef } from 'react';
import { Ribbon } from '../../shared/Ribbon';
import { Card } from '../shared/Card';
import { productCardConfiguration } from './ProductCardConfiguration';
import { productCardTitleCss } from './ProductCardStyles';

export const TestBrazeContentCard = () => {
	const brazeContainerElement = useRef(null);

	useEffect(() => {
		showContentCards(brazeContainerElement.current);
	}, []);

	const contentCards = getCachedContentCards();

	return (
		<>
			<div ref={brazeContainerElement}></div>
			<CustomCard cardsModel={contentCards} />
		</>
	);
};

const CustomCard = ({ cardsModel }: { cardsModel: ContentCards }) => {
	if (!cardsModel.cards.length) {
		return <></>;
	}

	const testCard = cardsModel.cards[0] as ClassicCard;

	const cardConfig = productCardConfiguration.guardianweekly;

	const ribbonCss = css`
		position: absolute;
		top: 50%;
		transform: translateY(-50%);
		right: 0;
	`;

	return (
		<Card>
			<Card.Header
				backgroundColor={cardConfig.colour}
				minHeightOverride="auto"
			>
				<h3 css={productCardTitleCss(true)}>{testCard.title}</h3>
				<Ribbon
					copy="Content card"
					ribbonColour={palette.brandAlt[400]}
					copyColour={palette.brand[400]}
					additionalCss={ribbonCss}
				/>
			</Card.Header>

			<Card.Section>
				<p>{testCard.description}</p>
				<img src="data:image/jpeg;base64," />
			</Card.Section>
		</Card>
	);
};
